import React from "react";
import "./BoxStyles.css";

export default function ChatBox() {
  return (
    <div className="section chat-box">
      <h2>Chat</h2>
      <p>Welcome to Chat CLI!</p>
      <p>Type your messages here...</p>
    </div>
  );
}
